  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:31.311852\",\n\t\"name\": \"nongame-birds-in-the-san-luis-valley-preliminary-report-1993\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is a brief summary of census results
  from 1992. The purpose of this work was 1) to collect baseline information on the
  abundance and distribution of nongame birds in the San Luis Valley and 2) to begin
  to explore patterns of habitat use by nongame birds. Birds were censused at four
  sites: Alamosa National Wildlife Refuge, Blanca Lakes. Russell Lakes and Mishak
  Lakes. These sites were chosen because of the availability of large wetland complexes
  and based on recommendations from wildlife managers in the valley . This study focused
  on temporary and emergent wetlands and the results should not be taken as representative
  of the entirety of these sites. For example. large open bodies of water were not
  censused although open water within or adjacent to emergent wetlands were censused.
  This report does indicate interesting differences in the abundance and distribution
  of birds and wetland cover types which may have potential application to management
  of nongame birds on the refuges . More detailed analysis of habitat use by specific
  species is currently under way.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
